	-- FORENG KEY TABLA REGION
    -- 1- se altera la tabla region donde su id_pais se le da el nombre de id_pais2
    -- y es referente a la tabla pais de su id que es (id).
    alter table Region add constraint id_pais2 foreign key (id_pais) references pais(id);
    
    -- FORENG KEY TABLA CIUDAD
    -- 2- Se altera la tabla Ciudad donde su id es id_pais y se le da de nombre id_pais3
    -- de referencia a la tabla region de su id que es (id).
    alter table Ciudad add constraint id_pais3 foreign key (id_pais) references pais(id);
    
    -- 3- Se altera la tabla Ciudad donde su id es id_region se le da de nombre id_region2
    -- de referencia ala tabla region de su id que es (id).
    alter table Ciudad add constraint id_region2 foreign key (id_region) references region(id);
    
    -- FORENG KEY TABLA EMPLEADO
    -- 4- Se altera la tabla Empleado que su id es id_pasi y se le da de nombre id_pais 
    -- de referencia a la tabla pais que su id es igual a id
    alter table Empleado add constraint id_pais foreign key (id_pais) references pais(id);
    
    -- 5- Se altera la tabla Empleado que su id es id_region y se le da de nombre id_region 
    -- de referencia a la tabla region que su id es igual a (id) 
	alter table Empleado add constraint id_region foreign key (id_region) references region(id);
    
    -- 6- Se altera la tabla Empleado que su id es id_ciudad y su nombre de constrain es 
    -- id_ciudad de referencia a la tabla de Ciudad que su id es igual a (id)
    alter table Empleado add constraint id_ciudad foreign key (id_ciudad) references ciudad(id);
    
    -- 7- S e altera la tabla empleado que su id es id_genero que su nombre dado es id_sexo de referencia a la 
    -- tabla de genero donde su is es igual a (id)
    alter table Empleado add constraint id_sexo foreign key (id_genero) references genero(id);
    
    -- 8- Se altera la tabla Empleado donde su id es id_estadoc su nombre dado es id_estadoc de referencia a la 
    -- tabla Estado_Civil que su id es igual a (id)
